import { BrowserRouter, Routes, Route } from "react-router-dom";
import { IndexPage } from "./pages";


const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<IndexPage />} />
        <Route path="/pages/curriculum" element={<Curriculum />} />
      </Routes>
    </BrowserRouter>



  );
};

export default App;
